import { getImageDimensions, getImageMediaType } from '../image'
import { IImageDimensions } from '../../types'

describe('@sphereon/ssi-sdk.core:image', () => {
  it('should return image type for svg base64', async (): Promise<void> => {
    const svg_base64 =
      ''

    const result: string | undefined = await getImageMediaType(svg_base64)

    expect(result).toEqual('image/svg+xml')
  })

  it('should return image dimensions for svg base64', async (): Promise<void> => {
    const svg_base64 =
      ''

    const result: IImageDimensions = await getImageDimensions(svg_base64)

    expect(result).toBeDefined()
    expect(result?.height).toEqual(1018)
    expect(result?.width).toEqual(1901)
  })

  it('should return image dimensions for a 2-layered svg base64', async (): Promise<void> => {
    const svg_base64 =
      ''

    const result: IImageDimensions = await getImageDimensions(svg_base64)
    expect(result).toBeDefined()
    expect(result?.height).toEqual(297)
    expect(result?.width).toEqual(210)
  })

  it('should return image dimensions for a animated svg base64', async (): Promise<void> => {
    const svg_base64 =
      ''

    const result: IImageDimensions = await getImageDimensions(svg_base64)
    expect(result).toBeDefined()
    expect(result?.height).toEqual(24)
    expect(result?.width).toEqual(24)
  })

  it('should return image type for png base64', async (): Promise<void> => {
    const png_base64 =
      ''

    const result: string | undefined = await getImageMediaType(png_base64)

    expect(result).toEqual('image/png')
  })

  it('should return image dimensions for png base64', async (): Promise<void> => {
    const png_base64 =
      ''

    const result: IImageDimensions = await getImageDimensions(png_base64)

    expect(result).toBeDefined()
    expect(result?.height).toEqual(116)
    expect(result?.width).toEqual(262)
  })

  it('should return image type for jpg base64', async (): Promise<void> => {
    const jpg_base64 =
      ''

    const result: string | undefined = await getImageMediaType(jpg_base64)

    expect(result).toEqual('image/jpg')
  })

  it('should return image dimensions for jpg base64', async (): Promise<void> => {
    const jpg_base64 =
      ''

    const result: IImageDimensions = await getImageDimensions(jpg_base64)

    expect(result).toBeDefined()
    expect(result?.height).toEqual(477)
    expect(result?.width).toEqual(500)
  })

  it('should return image type for bmp base64', async (): Promise<void> => {
    const bmp_base64 =
      ''

    const result: string | undefined = await getImageMediaType(bmp_base64)

    expect(result).toEqual('image/bmp')
  })

  it('should return image dimensions for bmp base64', async (): Promise<void> => {
    const bmp_base64 =
      ''

    const result: IImageDimensions = await getImageDimensions(bmp_base64)

    expect(result).toBeDefined()
    expect(result?.height).toEqual(200)
    expect(result?.width).toEqual(200)
  })

  it('should return image type for webp base64', async (): Promise<void> => {
    const webp_base64 =
      ''

    const result: string | undefined = await getImageMediaType(webp_base64)

    expect(result).toEqual('image/webp')
  })

  it('should return image dimensions for webp base64', async (): Promise<void> => {
    const webp_base64 =
      ''

    const result: IImageDimensions = await getImageDimensions(webp_base64)

    expect(result).toBeDefined()
    expect(result?.height).toEqual(368)
    expect(result?.width).toEqual(550)
  })
})
